import './index.scss'
import { useNavigate } from 'react-router-dom'

export default function Cabecalho({ onLoginClick, showLogin }) {
    const navigate = useNavigate();

    function logOff() {
        localStorage.removeItem('TOKEN');
        navigate('/', { state: { showLogin: false } });
    }

    return (
        <header className='cabecalho'>
            <div className='cabecalho-logo'>
                {localStorage.getItem('TOKEN') ? (
                    <div>
                        <h1>DEV<p>HUB</p></h1>
                        <span className="logoff-link">
                            Retornar para &nbsp;
                            <a href="#" onClick={logOff} className="logoff-button">
                                portada
                            </a>
                        </span>
                    </div>
                ) : (
                    <div className="cabecalho">
                        <div className="cabecalho-logo" style={{
                            width: 1350 + 'px'
                        }}>
                            <h1>DEV<p>HUB</p></h1>
                        </div>
                        <a href='#home' className='cabecalho-nav-item-link'>Home</a>
                        <a href='#portfolio' className='cabecalho-nav-item-link'>Portf√≥lio</a>
                        <a href='#agenda' className='cabecalho-nav-item-link'>Agenda</a>
                        <a href='#mensagens' className='cabecalho-nav-item-link'>Mensagens</a>
                        <a href='#faturamento' className='cabecalho-nav-item-link'>Faturamento</a>
                        
                        <button onClick={onLoginClick} className="cabecalho-botao">
                            <b>Login</b>
                        </button>
                    </div>
                )}
            </div>
        </header>
    )
}
